<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <style>
        @import url("https://fonts.googleapis.com/css2?family=Courgette&display=swap");
html {
  height: 100%;
}

body {
  margin: 0;
  background-color: #30308a;
  height: 100%;
  overflow: hidden;
  display: flex;
  align-items: center;
  justify-content: center;
  font-family: "Courgette", cursive;
}

.sent-off .slider, .sent-off .input, .sent-off .btn {
  display: none;
}

.icon-snow {
  position: absolute;
  top: -40px;
  left: -40px;
  pointer-events: none;
  width: auto;
  height: 150%;
  opacity: 0.6;
}
.icon-snow path {
  stroke: none;
}

.card {
  position: relative;
  width: 600px;
  margin: 0 auto;
  border-radius: 4px;
  padding: 40px;
  box-sizing: border-box;
  background: #fff;
  box-shadow: 0px 32px 47px rgba(32, 23, 23, 0.09);
}

h1 {
  margin: 0 0 20px;
}

.input {
  -webkit-appearance: none;
     -moz-appearance: none;
          appearance: none;
  outline: 0;
  border: none;
  border-bottom: 3px solid #454;
  max-width: 235px;
  display: inline-block;
  font-family: "Courgette", cursive;
}
.input:focus {
  border-color: #0fa573;
}

.author {
  display: inline-block;
  width: 100%;
  text-align: right;
}

.svg {
  position: absolute;
  top: -78px;
  left: -44px;
  right: -81px;
  pointer-events: none;
}

.svg-icon {
  width: 100%;
  height: auto;
}

.text-congratulations, .m-slider {
  font-size: 20px;
  line-height: 1.2;
}

.m-slider {
  margin: 0 -30px;
}

.swiper-container {
  width: 100%;
  height: 114px;
  padding-bottom: 40px;
}

.swiper-slide {
  width: 70%;
}

.m-slide {
  position: relative;
  box-sizing: border-box;
  padding: 15px 10px;
  background: #eee;
  border: 1px solid #eee;
  height: 125px;
  border-radius: 3px;
}

.swiper-slide {
  opacity: 0.6 !important;
  transition: all 0.6s;
}
.swiper-slide.swiper-slide-active {
  opacity: 1 !important;
}

.swiper-pagination-bullet-active {
  background-color: #0fa573;
}

.btn {
  display: table;
  box-sizing: border-box;
  text-decoration: none;
  background-color: #0fa573;
  border: 0;
  margin-top: 15px;
  line-height: 50px;
  padding: 0 15px;
  color: #fff;
  font-weight: 500;
  border-radius: 4px;
  width: 100%;
  cursor: pointer;
  font-size: 24px;
  text-align: center;
  transition: all 0.6s;
}
.btn:hover {
  background-color: #009b7d;
}

@media (max-width: 740px) {
  body {
    display: block;
    overflow: auto;
  }

  svg {
    display: none;
  }

  h1 {
    font-size: 24px;
  }

  .card {
    width: 100%;
  }

  .text-congratulations, .m-slider {
    font-size: 14px;
  }

  .btn {
    line-height: 34px;
    font-size: 18px;
  }
}

    </style>
</head>
